import React, { useState } from "react";
import axios from "axios";

const CreateAssessment = () => {
  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("");
  const [questions, setQuestions] = useState([
    { questionText: "", options: ["", "", "", ""], correctAnswer: "" },
  ]);

  const handleAddQuestion = () => {
    setQuestions([...questions, { questionText: "", options: ["", "", "", ""], correctAnswer: "" }]);
  };

  const handleChangeQuestion = (index, value) => {
    const newQuestions = [...questions];
    newQuestions[index].questionText = value;
    setQuestions(newQuestions);
  };

  const handleChangeOption = (qIndex, optIndex, value) => {
    const newQuestions = [...questions];
    newQuestions[qIndex].options[optIndex] = value;
    setQuestions(newQuestions);
  };

  const handleSelectCorrectAnswer = (qIndex, value) => {
    const newQuestions = [...questions];
    newQuestions[qIndex].correctAnswer = value;
    setQuestions(newQuestions);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post(
        "http://localhost:5000/api/assessments/create",
        { title, description, questions },
        { headers: { Authorization: `Bearer ${localStorage.getItem("token")}` } }
      );
      alert("Assessment Created Successfully");
    } catch (error) {
      console.error("Error creating assessment", error);
      alert("Failed to create assessment.");
    }
  };

  return (
    <>
      <style>
        {`
          .main-content {
            margin-left: 250px; /* Adjust according to sidebar width */
            padding: 20px;
          }

          .container {
            max-width: 900px;
            margin: auto;
            padding: 20px;
          }

          .card {
            background: #fff;
            border-radius: 10px;
            box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
            padding: 20px;
            margin-bottom: 20px;
          }

          .form-control {
            margin-bottom: 10px;
          }

          .btn {
            padding: 10px;
            font-size: 1rem;
            margin-top: 10px;
          }

          .btn-primary {
            background-color: #007bff;
            border: none;
            border-radius: 5px;
          }

          .btn-primary:hover {
            background-color: #0056b3;
          }

          .btn-secondary {
            background-color: #6c757d;
            border: none;
            border-radius: 5px;
          }

          .btn-secondary:hover {
            background-color: #545b62;
          }

          @media screen and (max-width: 768px) {
            .main-content {
              margin-left: 0;
              padding: 15px;
            }

            .container {
              padding: 10px;
            }

            .card {
              padding: 15px;
            }
          }
        `}
      </style>

      <div className="container main-content mt-5">
        <h2 className="text-center mb-4">Create Assessment</h2>
        <form onSubmit={handleSubmit}>
          <div className="card">
            <input
              type="text"
              className="form-control"
              placeholder="Assessment Title"
              value={title}
              onChange={(e) => setTitle(e.target.value)}
              required
            />
            <textarea
              className="form-control"
              placeholder="Description"
              value={description}
              onChange={(e) => setDescription(e.target.value)}
              required
            />
          </div>

          {questions.map((q, qIndex) => (
            <div className="card" key={qIndex}>
              <input
                type="text"
                className="form-control"
                placeholder={`Question ${qIndex + 1}`}
                value={q.questionText}
                onChange={(e) => handleChangeQuestion(qIndex, e.target.value)}
                required
              />
              {q.options.map((opt, optIndex) => (
                <input
                  key={optIndex}
                  type="text"
                  className="form-control"
                  placeholder={`Option ${optIndex + 1}`}
                  value={opt}
                  onChange={(e) => handleChangeOption(qIndex, optIndex, e.target.value)}
                  required
                />
              ))}
              <select
                className="form-control"
                value={q.correctAnswer}
                onChange={(e) => handleSelectCorrectAnswer(qIndex, e.target.value)}
                required
              >
                <option value="">Select Correct Answer</option>
                {q.options.map((opt, optIndex) => (
                  <option key={optIndex} value={opt}>
                    {opt}
                  </option>
                ))}
              </select>
            </div>
          ))}

          <button type="button" className="btn btn-secondary w-100" onClick={handleAddQuestion}>
            Add Question
          </button>
          <button type="submit" className="btn btn-primary w-100">
            Create Assessment
          </button>
        </form>
      </div>
    </>
  );
};

export default CreateAssessment;
